export default theme => ({
  root: {
    padding: theme.spacing.unit * 3
  },
  picture: {
    alignItems: 'center',
    borderRadius: '10%',
    display: 'inline-flex',
    height: '8rem',
    justifyContent: 'center',
    marginCenter: 'auto',
    width: '8rem'
  },
});
